import React from "react";

const StripIcon = (props) => {
  return (
    <svg
      width="14"
      height="1"
      viewBox="0 0 14 1"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      <path d="M0 0H14V1H0V0Z" fill="#1B4332" />
    </svg>
  );
};

export default StripIcon;
